import { useEffect, useState } from 'react';
import styled from 'styled-components';

interface Props {
  name: string;
  serialNumber: string;
  model: string;
}

const MachineBlock = (props) => {
  const { name, serialNumber, model } = props;

  return (
    <Styled.Block>
      <Styled.MachineDetails>
        <Styled.TextBlock>
          <Styled.Label>Name</Styled.Label>
          <Styled.Text>{}</Styled.Text>
        </Styled.TextBlock>
      </Styled.MachineDetails>
    </Styled.Block>
  );
};

const Styled = {
  MachineDetails: styled.div``,
  Block: styled.div`
    padding: ${(props) => props.theme.spacings.l};
    display: flex;
    align-items: flex-start;
    justify-content: center;
    flex-direction: column;
  `,
  Text: styled.span`
    font-size: 18px;
  `,
  TextBlock: styled.div`
    display: flex;
    align-items: flex-start;
    justify-content: center;
    flex-direction: column;
    padding: ${(props) => props.theme.spacings.m};
  `,
  Label: styled.span`
    font-size: 13px;
    font-weight: bold;
  `,
};

export default MachineBlock;
